import logo from './logo.png';
import './App.css';
import $ from 'jquery';

function NoteVoicingWizard() {
  return (
    <div className="NoteVoicingWizard">
      <header className="NoteVoicingWizard-header">
        <button className="record-button">
            Start recording
        </button>
      </header>
    </div>
  );
}

export default NoteVoicingWizard;
